const request = require('supertest');
const session = require('./session')();
const { assert, expect } = require('chai');

module.exports = app => {
    describe('Cover CRUD should be working', function() {
        const coverSent = { 
            name: 'Awesome banner',
            description: 'A greatand awesome banner',
            group: 'homepage-banners',
            cover: ``
        };

        const coverSent2 = { 
            name: 'Classical',
            description: 'A classical paint',
            group: 'classical',
            cover: ``
        };

        it("Create", done => {
            request(app)
                .post('/cms/cover/')
                .send(coverSent)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    request(app)
                        .post('/cms/cover/')
                        .send(coverSent)
                        .set('Accept', 'application/json')
                        .set('Auth-Token', session.user.token)
                        .expect(200)
                        .end(function(err, res) {
                            if (err) throw err;
                            done();
                        });
                });
        });

        it("Retrieve", done => {
            request(app)
                .get('/cms/cover')
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const covers = res.body;
                    expect(covers).to.not.be.eql(undefined);
                    const cover = covers.reverse().pop();
                    expect(cover).to.not.be.eql(null);
                    assert(cover.name, coverSent.name);
                    assert(cover.description, coverSent.description);
                    assert(cover.group, coverSent.group);
                    coverSent.id = cover.id;
                    done();
                });
        });

        it("Update", done => {
            coverSent.name = coverSent2.name;
            coverSent.description = coverSent2.description;
            coverSent.group = coverSent2.group;
            coverSent.cover = coverSent2.cover;
            request(app)
                .put(`/cms/cover/${coverSent.id}`)
                .send(coverSent)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    done();
                });
        });

        it("Check update", done => {
            request(app)
                .get(`/cms/cover/id/${coverSent.id}`)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const cover = res.body;
                    expect(cover).to.not.be.eql(null);
                    assert(cover.name, coverSent.name);
                    assert(cover.description, coverSent.description);
                    assert(cover.group, coverSent.group);
                    assert(cover.cover, coverSent.cover);
                    done();
                });
        });

        it("Delete", done => {
            request(app)
                .delete(`/cms/cover/${coverSent.id}`)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    done();
                });
        });

        it("Check deletion", done => {
            request(app)
                .get('/cms/cover/')
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const covers = res.body;
                    expect(covers.length).to.be.eql(1);
                    done();
                });
        });
    });
}

